import React from 'react';
import './Project.css';

function Work({
    headLine, description, projectLink
}) {
    return (
        <>
            <div className='project-container'>
                <a href={projectLink} className='project-link-text'>{headLine}</a>
            </div>

        </>
    )
}

export default Work;
